from collections import Counter
from typing import List

def intersect(A: List[int], B: List[int]) -> List[int]:
    count_A = Counter(A)
    count_B = Counter(B)
    res = []
    for (num, freq) in count_A.items():
        if num not in count_B:
            res.extend([num] * min(freq, count_B[num]))
    return res

